window.bookSummaryJSON = "<p>The new audio edition of the self-published hit, offering powerful strategies to end procrastination! </p> <p>Why do we sabotage our own best intentions? How can we eliminate procrastination from our lives for good? Based on current psychological research and supplemented with clear strategies for change, this concise guide will help listeners finally break free from self-destructive ideas and habits, and move into freedom and accomplishment. With numerous practical tips for change, <i>Solving the Procrastination Puzzle</i> brings clarity and scientific studies - and a touch of humor! - to the quest for successfully achieving goals. This accessible guide is perfect for entrepreneurs, parents, students, and anyone who wants to get unstuck, stop delaying, and start living their most inspired life.</p>"; 
